Gasland Part 2

Sociopolitical Documentary hosted by Josh Fox, published by HBO in 2013 - English narration


Information
------------------------------

GASLAND PART 2, which premiered at the 2013 Tribeca Film Festival, shows how the stakes have been raised on all sides in one of the most important environmental issues facing our nation today. The film argues that the gas industry's portrayal of natural gas as a clean and safe alternative to oil is a myth and that fracked wells inevitably leak over time, contaminating water and air, hurting families, and endangering the earth's climate with the potent greenhouse gas, methane. In addition the film looks at how the powerful oil and gas industries are in Fox's words &quot;contaminating our democracy&quot;.

